import git from '../git.svg';

const Footer = (props) => {
  return (
 <div class="flex">
  <div class="border--dotted w-100 pa3 mr2">
    <div className="tc w-2 h-2 ">
		<span><a href="#top"><img src={git} /></a></span><h3>Lets Connect</h3>
    </div>
    </div>
</div>

	)
}

export default Footer;
